import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
	intro: {
		display: "flex",
		alignItems: "center",
		margin: "6rem 0 2rem 0",
		height: "70vh",
	},
	about: {
		lineHeight: "4rem",
	},
	profileImg: {
		borderRadius: "10%",
		"@media (max-width: 780px)": {
			display: "none",
		},
	},
	highlights: {
		backgroundColor: "#f39c12",
		padding: "5px",
	},
	paper: {
		display: "flex",
		margin: "2rem 0",
		"@media (max-width: 780px)": {
			display: "flex",
			flexDirection: "column",
		},
	},
	details: {
		padding: "2rem 0 0 4rem",
		"@media (max-width: 780px)": {
			padding: "1rem",
		},
	},
	title: {
		textAlign: "center",
	},
	projectImage: {
		height: "100%",
		"@media (max-width: 780px)": {
			width: "100%",
		},
	},
	contact: {
		display: "flex",
		flexDirection: "column",
		alignItems: "center",
		justifyContent: "center",
		height: "20vh",
		backgroundColor: "#f39c12",
		color: "#17202a",
		marginBottom: "4rem",
	},
}));
